const {
  AccountCircle,
  HomeRounded,
  PhoneAndroidRounded,
} = require("@material-ui/icons");
const { default: InputCustomize } = require("./components/InputCustomize");

export const structure = [
  {
    section: "Infomation",
    fields: [
      {
        name: "fistName",
        title: "First Name",
        component: () => (
          <InputCustomize icon={() => <AccountCircle color="primary" />} />
        ),
      },
      {
        name: "lastName",
        title: "Last Name",
        component: () => (
          <InputCustomize icon={() => <AccountCircle color="primary" />} />
        ),
      },
      {
        name: "age",
        title: "Age",
        component: () => (
          <InputCustomize icon={() => <AccountCircle color="primary" />} />
        ),
      },
    ],
  },
  {
    section: "Contact",
    fields: [
      {
        name: "address",
        title: "Address",
        component: () => (
          <InputCustomize icon={() => <HomeRounded color="primary" />} />
        ),
      },
      {
        name: "email",
        title: "Email",
        component: () => (
          <InputCustomize icon={() => <AccountCircle color="primary" />} />
        ),
      },
      {
        name: "phone",
        title: "Phone",
        component: () => (
          <InputCustomize
            icon={() => <PhoneAndroidRounded color="primary" />}
          />
        ),
      },
    ],
  },
  {
    section: "Social Media",
  },
  {
    section: "Infomation",
  },
];
